import './App.css';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import EmployeeList from './Components/EmployeeList';
import EmployeeContextProvider from './contexts/EmployeeContext';

function App() {
  return (
    <EmployeeContextProvider>
      <Router>
        <NavbarPage />
        <Switch>
          <EmployeeList />
        </Switch>
      </Router>
    </EmployeeContextProvider>

  );
}

export default App;
